import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <table style = {{
        backgroundColor: '#000',
        display: 'block',
        color: '#fff',
        paddingLeft: 16,
      }}>
        <tbody>
          <tr>
            <td width = "8">
              <img width = "100" src = "DSC01148.JPG"/>
            </td>
            <h1>
              Favorite Movies
            </h1>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default App;
